import Link from 'next/link';

const Navbar = () => (
    
        <nav>
            <ul>
            <li><Link href="/">Home</Link></li>
            <li><Link href="/About"><a>About</a></Link></li>
            <li><Link href="/Projects"> <a>Projects</a> </Link></li>
            <li><Link href="/Contact"><a>Contact</a>  </Link></li>
            </ul>
        </nav>

)
export default Navbar;
